import React from "react";
import { useContext } from 'react';
import { Link } from 'react-router-dom';
import { Segment } from "semantic-ui-react";
import { Button } from "semantic-ui-react";

function NavBar() {
  return (
    <Segment id="headerBar" inverted vertical size="tiny">
      <Button id="play-game-button" inverted color="green" class="ui button">
        <Link to="/playgame">Play Now</Link>
      </Button>

      <Button id="information-button" inverted class="ui button">
        <Link to="/information">Information</Link>
      </Button>

      <Button id="settings-button" inverted class="ui button">
        <Link to="/settings">Settings</Link>
      </Button>

      <Link to="/login">
        <Button id="login-button" inverted class="ui button">
          Login
        </Button>
      </Link>

      <Link to="/register">
        <Button id="register-button" inverted class="ui button">
          Register Account
        </Button>
      </Link>
    </Segment>
  );
}

export default NavBar;
